import React from "react";
import { useParams, Route, Routes } from "react-router-dom";
import Comments from '../components/comments/Comments'

const QuoteDetails = () => {
  const params = useParams();
  return (
    <Fragment>
    <h1>Quote Detail Page</h1>
    <p>{params.quoteId}</p>
    <Routes>
      <Route 
        path="comments"
        element={<Comments />}
      />
    </Routes>
  </Fragment>
  );
};

export default QuoteDetails;
